import React from 'react';
import About from './about';
import './navbar.css'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

export default function Navbar() {
  return (
    <Router>
        <header class="header-background"> 
	        <h1> Carter's Concoctions </h1>
	        <nav>
                <a>Home</a>
                <a>About Me</a>
	        </nav>
	    </header>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
        </Switch>

    </Router>
  );
}
